&lt;div class="additions">&lt;a name="h220-1">&lt;/a>&lt;h5>3. Импорт карт в&amp;nbsp;AMBS&lt;/h5>&lt;a name="h220-2">&lt;/a>&lt;h5>Пример импорта карт&lt;/h5> 
Требуется  добавить в&amp;nbsp;систему 3 карты:&lt;br />
С&amp;nbsp;учетом следующих условий: &lt;br />
&lt;ol type="1">&lt;li> Карты нужно добавить в&amp;nbsp;отдельный лот&amp;nbsp;с&amp;nbsp;именем &amp;ndash; Test.
&lt;/li>&lt;li> Период активации карточек должен быть неограниченным.
&lt;/li>&lt;li> Карточки после активации должны работать только 90 дней.
&lt;/li>&lt;/ol>&lt;ul>&lt;li> в&amp;nbsp;поле  «Lot prefix» &amp;ndash; указываем префикс лота test (обязательное поле);
&lt;/li>&lt;li> в&amp;nbsp;поле «Pin length» &amp;ndash; ставим значение 5 символов 
&lt;/li>&lt;/ul>&lt;div class="indent">(для каждой карты в&amp;nbsp;системе должны быть ПИН+КЕЙ, поскольку в&amp;nbsp;исходных данных ПИН&amp;nbsp;дан одним набором из&amp;nbsp;8 цифр, &lt;br />
прийдется его&amp;nbsp;разделить на&amp;nbsp;ПИН+КЕЙ в&amp;nbsp;Excel-е, например как&amp;nbsp;5+3);&lt;br />
&lt;/div>&lt;ul>&lt;li> в&amp;nbsp;поле «Pin key&amp;nbsp;length» &amp;ndash; ставим значение 3 (5+3);
&lt;/li>&lt;li> в&amp;nbsp;поле «Activation period» &amp;ndash; ставим значение 10 лет&amp;nbsp;(неограниченного срока нет, 10 лет&amp;nbsp;достаточно большой период для&amp;nbsp;карты );
&lt;/li>&lt;li> в&amp;nbsp;поле «Live period» &amp;ndash; ставим 90 &amp;laquo;дней&amp;raquo;.&lt;/li>&lt;/ul>
2. Загружаемый csv-файл будет выглядеть следующим образом:&lt;br />
